import { objOf } from './objOf';
describe('data first', function () {
    test('wrap value', function () {
        var actual = objOf(10, 'a');
        expect(actual.a).toEqual(10);
        expect(actual).toEqual({ a: 10 });
    });
});
describe('data last', function () {
    test('wrap value', function () {
        var actual = objOf('a')(10);
        expect(actual.a).toEqual(10);
        expect(actual).toEqual({ a: 10 });
    });
});
